import { Component } from "react";
import styles from './SkillsContainer.module.css';
import './SkillsContainer.css';

export default class SkillsContainer extends Component {
    constructor() {
        super();
    }

    render() {
        return (
            <div className={styles.mainContainer}>
                <div className={styles.sideLeftContainer}></div>
                <div className={styles.centerContainer}></div>
                <div className={styles.sideRightContainer}></div>
            </div>
        );
    }
}
